So now that I've gone over what enums are and you're confused and wondering about the emotional well-being of my friend group when we play league, we can talk about Rust, which was the original reason we were here. Rust bypasses the need for arbitrary values, which solves the second issue. When we define an enum, we don't give it any values at all, and the compiler handles making them different. // I'm a basic rust snippet. I'm probably a midlaner who complains about
// assassins being too weak // here's our enum
enum Lane { Top, Jg, Mid, Bot, Sup,
} // we can do easy comparisons with match statements
let lane: Lane = Lane::Sup;
match lane { Lane::Top => println!("I'm a top laner"), Lane::Jg => println!("I'm a jungle laner"), Lane::Mid => println!("I'm a mid laner"), Lane::Bot => println!("I'm the main character.. right? please tell me I'm the main character"), Lane::Sup => println!("I'm babysitting 4 screaming children please help"),
} The most interesting part about Rust enums, however, is that you can easily tie unique data to the different options. This solves the first issue, since we immediately know what information we're getting, since it's directly attached to the enum member itself.

