Rust has two (yes, two) String types, which can be somewhat difficult to wrap your head around as a new Rust programmer. We will discuss &str in further detail in the Borrowing chapter, but for now, &str provides a static, immutable reference to a string, such as what you would get by immediately definining a string in other languages: # This is in Python
print("This would be a &str") // This is in Rust
fn main() { println!("This is a &str");
} If you need to modify a string (or specifically need a String type for a function call) you can create one either from the String::new() or String::from() constructors. let mut s1 = String::new();
s1.push("Hello, ");
s1.push("World"); let mut s2 = String::from("Hello, world");
s2.push("More text"); String and &str can be easily converted to one another using to_string()/to_owned() and as_str(). let a_str: &str = "I'm a &str";
// Note that calling `to_string` or `to_owned` makes a copy of the str
let a_String: String = a_str.to_owned();
let another_str: &str = a_String.as_str(); Documentation String , &str
